pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import { LibItem } from "../libraries/LibItem.sol";
import { LibFeeManager } from "../libraries/LibFeeManager.sol";
import { LibSaleOrder } from "../libraries/LibSaleOrder.sol";
import "../utils/math/SafeMath.sol";
import "../interfaces/IERC20.sol";
import "../interfaces/IERC1155.sol";

contract BuyerFacet  {

    using SafeMath for uint256;

    event purchase(uint256 indexed _orderId,address indexed _buyer,uint256 _price,uint256 indexed _itemId,address _NFTAddress,address _currency);

    function purchaseOneNFT(bytes32 _orderCode) external {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        uint256 _orderId = LibSaleOrder._getOrderIdByCode(_orderCode);

        LibDiamond.SaleOrder storage _order = ds.orders[_orderId];

        uint256 _itemInOrderLength = _order.itemCount;

        require(_order.status == LibDiamond.OrderStatus.OnSell,"ORDER IS SOLD OUT OR CANCEL");
        require(block.timestamp <= _order.sellPeriod ,"ORDER IS ENDED");
        // check order is one Item and check order is exist 
        require(_itemInOrderLength == 1 ,"INVALID ORDER");


        LibDiamond.SaleItem memory _item = LibItem._getItemByOrderId(_orderId)[0];

        uint256 _feeMerketPlacePrice = _calculateFee(_item.price,LibFeeManager._getFeeMarketPlace());
        uint256 _feeFirstOwnerPrice =  _calculateFee(_item.price,LibFeeManager._getFirstOwnerFee());
        uint256 userReciptAmountPrice = _item.price.sub(_feeMerketPlacePrice).sub(_feeFirstOwnerPrice);

        if(_isHaveFirstOwner(_item.tokenContract) == true){
            IERC20(_order.currency).transferFrom(msg.sender,IERC1155(_item.tokenContract).getFirstOwner(_item.tokenId) , _feeFirstOwnerPrice);
        }else{
            _feeMerketPlacePrice = _feeMerketPlacePrice.add(_feeFirstOwnerPrice);
        }

        // transfer to market
        IERC20(_order.currency).transferFrom(msg.sender,address(this) , _feeMerketPlacePrice);
        // transfer to seller
        IERC20(_order.currency).transferFrom(msg.sender,_order.owner , userReciptAmountPrice);
        // transfer NFT to buyer
        IERC1155(_item.tokenContract).safeTransferFrom(_order.owner,msg.sender,_item.tokenId,_item.amount,"");

        _order.status = LibDiamond.OrderStatus.SoldOut;

        _changeUserOrdersToSoldOut(msg.sender,_order.id);
        // decrease user nft on sell 
        _decreaseNFTOnSell(_order.owner,_item.tokenContract,_item.tokenId);

        emit purchase(_order.id,msg.sender,_order.price, _item.id,_item.tokenContract,_order.currency);

    }
    function _decreaseNFTOnSell(address _user,address _nftTokenAddress,uint256 _nftTokenId) private {
        bytes32 _keyMapOrderIdToIndex = keccak256(abi.encode("USER.NFT.ID.AMOUNT.ONSELL",_user,_nftTokenAddress,_nftTokenId));
        uint256 _amountUserItemOnSell = LibDiamond.getUint(_keyMapOrderIdToIndex);
        LibDiamond.setUint(_keyMapOrderIdToIndex,_amountUserItemOnSell.sub(1));
    }
    function _changeUserOrdersToSoldOut(address _user,uint256 _orderId) private {
        bytes32 _keyUserOrdersOnSell = keccak256(abi.encode("USER.ORDER.IDS.ONSELL",_user));
        uint256[] storage _userOrderIds = LibDiamond.getArrayUint(_keyUserOrdersOnSell);

        bytes32 _keyMapOrderIdToIndexIsExist = keccak256(abi.encode("USER.ORDER.ID.TO.INDEX.IS.EXIST.ONSELL",_user,_orderId));

        if(LibDiamond.getBool(_keyMapOrderIdToIndexIsExist) == true){
            bytes32 _keyMapOrderIdToIndex= keccak256(abi.encode("USER.ORDER.ID.TO.INDEX.ONSELL",_user,_orderId));

            delete _userOrderIds[LibDiamond.getUint(_keyMapOrderIdToIndex)];

            bytes32 _keyUserOrdersSoldOut = keccak256(abi.encode("USER.ORDER.IDS.SOLDOUT",_user));
            uint256[] storage _userOrderIdsSoldOut = LibDiamond.getArrayUint(_keyUserOrdersSoldOut);
            _userOrderIdsSoldOut.push(_orderId);
        }    
    }


    function _calculateFee(uint256 _price,uint256 _fee) internal view returns(uint256){
        return _price.mul(_fee).div(LibFeeManager._getFeeDecimal());
    }


    function _isHaveFirstOwner(address _nftContractAddress) private view returns(bool){
        return LibDiamond.getBool(keccak256(abi.encodePacked("NFTMARKETPLACE:NFT.CONTRACT.HAVE.FIRST.OWNER",_nftContractAddress)));
    }

    function getItemByCode(bytes32 _itemCode) private view returns(LibDiamond.SaleItem storage){
        return LibItem._getItem(
            LibItem._getItemIdByCode(_itemCode)
        );
    }
    function _checkSellerBalance(address _tokenContract,uint256 _tokenId,address _seller,uint256 _amount) private {
        require(
            _amount <= _getSellerBalance(_tokenContract,_tokenId,_seller) ,"INVALID SELLER BALANCE"
        );
    }
    function _getSellerBalance(address _tokenContract,uint256 _tokenId,address _seller) private returns(uint256) {
        return IERC1155(_tokenContract).balanceOf(_seller,_tokenId);
    }
}
